class Solution:
    #   Time Limit Exceeded
    def sumOfDistancesInTree0(self, N, edges):
        if N <= 1:
            return [0]
        edgeDict = defaultdict(list)
        for a, b in edges:
            edgeDict[a].append(b)
            edgeDict[b].append(a)
        NUM_NODES = len(edgeDict.keys())
        grid = [[0] * NUM_NODES for _ in range(NUM_NODES)]

        def bfs(node):
            q, visited = [(0, node)], set()
            while q:
                dist, n = q.pop(0)
                visited.add(n)
                grid[node][n] = grid[n][node] = dist
                for c in edgeDict[n]:
                    if c in visited:
                        continue
                    q.append((dist + 1, c))

        for n in range(NUM_NODES):
            bfs(n)

        return [sum(row) for row in grid]

    def sumOfDistancesInTree1(self, N, edges):
        if N <= 1:
            return [0]
        edgeDict = defaultdict(list)
        for a, b in edges:
            edgeDict[a].append(b)
            edgeDict[b].append(a)
        NUM_NODES = len(edgeDict.keys())

        q, visited, depthDict, parentDict = [(-1, 0, 0)], set(), defaultdict(int), {}
        while q:
            parent, depth, n = q.pop(0)
            depthDict[n] = depth
            parentDict[n] = parent
            visited.add(n)
            for c in edgeDict[n]:
                if c in visited:
                    continue
                q.append((n, depth + 1, c))
        parentsDict = defaultdict(list)
        for n in range(NUM_NODES):
            parent = parentDict[n]
            while -1 < parent:
                parentsDict[n].append(parent)
                parent = parentDict[parent]

        def getLCA(parents1, parents2):
            for p1 in parents1:
                for p2 in parents2:
                    if p1 == p2:
                        return p1
            return -1

        grid = [[float('inf')] * NUM_NODES for _ in range(NUM_NODES)]
        for n in range(NUM_NODES):
            grid[n][n] = 0
        for i in range(NUM_NODES):
            for j in range(NUM_NODES):
                if i == j:
                    continue
            #for j in range(i + 1, NUM_NODES):
                #print('{} -> {}\t{} -> {}'.format(i, parentsDict[i], j, parentsDict[j]))
                if i in parentsDict[j]:
                    val = depthDict[j] - depthDict[i]
                    #grid[i][j] = grid[j][i] = depthDict[j] - depthDict[j]
