                    #else:
                    #    val = depthDict[i] + depthDict[j] - 2 * depthDict[lca]
                    val = depthDict[i] + depthDict[j] - 2 * depthDict[lca]
                    #grid[i][j] = grid[j][i] = depthDict[i] + depthDict[j] - 2 * depthDict[lca]
